import "./App.css";

// apikey = 5c806954

// const API_URL = 'https://www.omdbapi.com/?i=tt3896198&apikey=5c806954'

async function getData() {
  const url = "https://www.omdbapi.com/?i=tt3896198&apikey=5c806954";
  try {
    const response = await fetch(url);
    if (!response.ok) {
      throw new Error(`Response status: ${response.status}`);
    }

    const json = await response.json();
    console.log(json);
  } catch (error) {
    console.error(error.message);
  }
}


function App() {
  return (
    <div className="App">
      <h1>Hello, React</h1>
    </div>
  );
}

export default App;
